import React from "react";
import "./../css/User.css"
import search_p from "./../Image/BUTTON_search.png"


class User extends React.Component
{
        constructor(props) 
        {
                super(props);
        };

        render()
        {
          return (
                <div className="App">
                  <header className="App-header">


                  <div className="user_box">   
                      <div className="user_box2">
                        <h2 className="user_text"> User </h2>
                        <div className="user_box3" style = { { display: 'center' }} onClick={()=> this.handleClick_Regsiter()} > REGISTER </div>
                        <div className="user_box3"  display='center' onClick={()=> this.handleClick_Sign_in()} > SIGN UP </div>
                      </div>

                      <div className="user_hole2"> </div>

                      <div className="user_box2">
                        <h2 className="user_text"> Search </h2>
                        <img src={[search_p]} className="land_Icon" align='center' onClick={()=> this.handleClick_Search2()} />
                        <p className="user_text"> --------- </p>
                        <form className="user_Base">
                          <input className="user_Base" type="text"  placeholder = "Seach ...."  name="name"  />
                        </form>
                      </div>
                    </div>

                  </header>

                </div>
              );
        }
}

export default User;
